import { ENGAGEMENT_STATS } from "../ActionTypes";
import { fetchFromServer } from "../Fetch";

export const fetchEngagementStats = () => async dispatch => {
  let engagementStats = {
    groupEngagement: "",
    userEngagement: ""
  };

  const groupQuery = `query{
    groupEngagement{
      groupsActive
      groupMeetingFrequency{
        value
        count
      }

    }
  }`;

  const groupResponse = await fetchFromServer("post", groupQuery);

  engagementStats.groupEngagement = groupResponse.data.data.groupEngagement;

  const userQuery = `query{
    userStats{
      usersActive 
    }
  }`;

  const userResponse = await fetchFromServer("post", userQuery);

  console.log(userResponse);

  engagementStats.userEngagement = userResponse.data.data.userStats.usersActive;

  console.log(engagementStats);

  dispatch({
    type: ENGAGEMENT_STATS,
    payload: engagementStats
  });
};
